// App.jsx
import React, { useState, useEffect } from 'react';
import './call_insights.css';

function App() {
  const [data, setData] = useState(null);
  // Four accordion items (adjust the number as needed)
  const [accordionState, setAccordionState] = useState([false, false, false, false]);

  // Fetch JSON output from the Python backend (via Express)
  useEffect(() => {
    fetch('http://localhost:5001/api/output')
      .then(response => response.json())
      .then(json => setData(json))
      .catch(err => console.error('Error fetching data:', err));
  }, []);

  const toggleAccordion = index => {
    setAccordionState(prev => {
      const newState = [...prev];
      newState[index] = !newState[index];
      return newState;
    });
  };

  if (!data) {
    return <div>Loading...</div>;
  }

  return (
    <div className="container">
      {/* TOP BAR */}
      <div className="top-bar">
        <div className="logo">Call Insights</div>
      </div>

      {/* CONTENT WRAPPER */}
      <div className="content">
        {/* SIDEBAR */}
        <div className="sidebar">
          <h2>Call Rating</h2>
          <div className="match-rate-circle" data-percentage="85">
            <span className="percentage">85%</span>
          </div>
          <div className="sidebar-section">
            <h4>Buyer Intent</h4>
            <p>
              <strong>Predicted:</strong> <span style={{ color: 'green' }}>{data.buyer_intent.output}</span>
            </p>
          </div>
          <div className="sidebar-section">
            <h4>Profanity Detection</h4>
            <p>
              <strong>Severity Level:</strong> {data.profanity_check.output}
            </p>
          </div>
        </div>

        {/* MAIN SECTION */}
        <div className="main-section">
          {/* Call Summary Section */}
          <div className="section-card">
            <h3>Call Summary</h3>
            <div style={{ whiteSpace: 'pre-wrap' }}>
              {data.call_summary.output}
            </div>
            <h3>Overall Call Score: 85/100</h3>
          </div>

          {/* Strengths & Areas for Improvement (Static for now) */}
          <div className="section-card">
            <div style={{ display: 'flex', flexWrap: 'wrap', gap: '2rem' }}>
              <div style={{ flex: 1 }}>
                <h3>Strengths</h3>
                <ul>
                  <li><strong>Strong opening:</strong> Clear introduction and relevance.</li>
                  <li><strong>Good discovery:</strong> Open-ended questions revealing pain points.</li>
                  <li><strong>Effective presentation:</strong> Communicates benefits well.</li>
                  <li><strong>Professional tone:</strong> Polite and engaging conversation.</li>
                </ul>
              </div>
              <div style={{ flex: 1 }}>
                <h3>Areas for Improvement</h3>
                <ul>
                  <li><strong>Lack of depth:</strong> Could probe further on key issues.</li>
                  <li><strong>No clear next steps:</strong> Needs explicit follow-up actions.</li>
                </ul>
              </div>
            </div>
          </div>

          {/* Detailed Analysis with Accordion */}
          <div className="section-card">
            <h3>Detailed Analysis</h3>
            <div className="accordion">
              <div className="accordion-item">
                <div 
                  className={`accordion-header ${accordionState[0] ? 'active' : ''}`} 
                  onClick={() => toggleAccordion(0)}
                >
                  Conversational Balance
                </div>
                <div className={`accordion-content ${accordionState[0] ? 'show' : ''}`}>
                  <p>
                    {data.custom_rag_analysis.output.length > 200
                      ? data.custom_rag_analysis.output.substring(0, 200) + "..."
                      : data.custom_rag_analysis.output}
                  </p>
                </div>
              </div>
              <div className="accordion-item">
                <div 
                  className={`accordion-header ${accordionState[1] ? 'active' : ''}`} 
                  onClick={() => toggleAccordion(1)}
                >
                  Objection Handling
                </div>
                <div className={`accordion-content ${accordionState[1] ? 'show' : ''}`}>
                  <p>
                    Additional feedback on handling objections goes here.
                  </p>
                </div>
              </div>
              <div className="accordion-item">
                <div 
                  className={`accordion-header ${accordionState[2] ? 'active' : ''}`} 
                  onClick={() => toggleAccordion(2)}
                >
                  Pitch Optimization
                </div>
                <div className={`accordion-content ${accordionState[2] ? 'show' : ''}`}>
                  <p>
                    Suggestions for optimizing your pitch and messaging.
                  </p>
                </div>
              </div>
              <div className="accordion-item">
                <div 
                  className={`accordion-header ${accordionState[3] ? 'active' : ''}`} 
                  onClick={() => toggleAccordion(3)}
                >
                  Call-to-Action Execution
                </div>
                <div className={`accordion-content ${accordionState[3] ? 'show' : ''}`}>
                  <p>
                    Feedback on call-to-action and next steps for follow-up.
                  </p>
                </div>
              </div>
            </div>
            <p>
              By implementing these suggestions, you'll create a more balanced conversation and optimize your approach.
            </p>
          </div>

          {/* Footer Actions */}
          <div className="footer-actions">
            <button>Generate Follow-Up Email</button>
            <button>Schedule Next Call</button>
            <button>View Transcript</button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
